  false,\n\t\"url\": null,\n\t\"notes\": \"This data type contains data from sampling
  and analysis of marine zooplankton. Information on zooplankton abundance, distribution
  and productivity derived from these data support studies of marine populations and
  ecosystems. Data reported may include: cruise information, position, date and time
  of sampling, bottom and sampling depths, water temperature and salinity, and total
  haul data. Data on zooplankton catch by species may include subsample size, zooplankton
  concentration, life history code and numbers of adults, juveniles, larvae, and eggs.
  Estimated density of holoplankton and meroplanton and data on ichthyoplankton may
  also be reported. Specimens are identified by NODC Taxonomic Codes.\",\n\t\"license_title\":
